import React, { Component } from "react";
import { Card, InputGroup, FormControl, Button } from "react-bootstrap";
import "./all.css";
export default class SearchBar extends Component {
  render() {
    return (
      <div class="container my-4 ">
        <div className="topMargin leftmargin ">
          <Card border="light" style={{ width: '50rem' }}>
            <Card.Body>
              <InputGroup className="mb-3 ">
                <FormControl
                  placeholder="Search"
                  aria-label="Search"
                  aria-describedby="basic-addon2"
                  id="searchBar"
                />
                <InputGroup.Append>
                  <Button variant="outline-info" id="searchBtn">
                    Search
                  </Button>
                </InputGroup.Append>
              </InputGroup>
            </Card.Body>
          </Card>
        </div>
      </div>
    );
    const id = document.querySelector('#searchBar').value
    console.log(id)
  }
}
